import React from "react";
import WelcomeComp from "../components/aboutWelcome/AboutWelcome";
import AboutContent from "../components/aboutContent/AboutContent";

function About() {
  return (
    <div>
      <WelcomeComp pageName="About Me" />
      <AboutContent />
    </div>
  );
}

export default About;
